import React from "react";
import { NavLink } from "react-router-dom";

function Footer() {
  return (
    <div id="footer">
      <br/>
      <div align="center">Copyright &copy; Dav1 | Design by <a href="http://freshtemplates.com/">Website Templates</a></div>
    </div>
  );
}
export default Footer;
